body {
  font-family: "Nunito", sans-serif;
  color: #6d5d4b;
  font-weight: 300;
  line-height: 1.6;
}

.container {
  width: 100%;
  height: 100vh;
  background: linear-gradient(#c9d6ff, #e2e2e2);
  display: grid;
  grid-template-columns: minmax(5rem, 25rem) 1fr minmax(5rem, 25rem);
  grid-template-rows: 10rem 1fr 5rem;
}

.app__container {
  grid-row: 2/3;
  grid-column: 2/3;
  background-color: white;
  opacity: 1;
  display: grid;
  grid-template-columns: minmax(5rem, 25rem) 1fr minmax(5rem, 15rem);
  grid-template-rows: 10rem 1fr 10rem;
  box-shadow: 7px 7px 11px -6px rgba(0, 0, 0, 0.51);
}

.app__nav {
  grid-row: 1/-1;
  grid-column: 1/2;
  background-color: #e4eaff;
  opacity: 1;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: flex-start;
}

.app__nav__logo {
  width: 100%;
  height: 20%;
  margin-top: 7rem;
  position: relative;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
}

.app__nav__nav {
  justify-self: flex-start;
  width: 100%;
  height: 50%;
}

.logo {
  width: 7rem;
  fill: #5d7de7;
}

.logo__h1 {
  font-size: 2rem;
  color: #5d7de7;
  font-weight: lighter;
  font-style: italic;
}

.nav__list {
  width: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: flex-start;
  margin-top: 2rem;
  list-style: none;
}

.nav__item {
  margin-top: 2rem;
  position: relative;
  display: flex;
  align-items: center;
  justify-content: center;
  width: 100%;
  vertical-align: center;
  text-decoration: none;
  height: 5rem;
  font-size: 2rem;
  left: 2rem;
  cursor: pointer;
  z-index: 1;
  color: #6685e8;
}

.nav__item::before {
  content: "";
  position: absolute;
  top: 0;
  left: -2rem;
  display: block;
  width: 0;
  height: 100%;
  transition: all 0.3s ease-out;
  color: #ecf0ff;
  background-color: #ecf0ff;
  opacity: 1;
  z-index: -2;
}

.nav__item:hover::before {
  width: 100%;
}

.icon__item {
  width: 2rem;
  height: 2rem;
  position: absolute;
  left: 5rem;
  top: 1.3rem;
  fill: #6685e8;
}

.conditionst {
  margin-top: auto;
  margin-bottom: 2rem;
  opacity: 0.7;
}

.app__menu {
  grid-row: 1/-1;
  grid-column: 2/4;
  background-color: #e4eaff;
  opacity: 0.7;
  display: grid;
  grid-template-columns: minmax(2rem, 4rem) 1fr minmax(2rem, 4rem);
  grid-template-rows: 3rem 1fr 3rem;
}

.menu__mainStock {
  grid-row: 2/3;
  grid-column: 2/3;
  display: grid;
  grid-template-columns: 2rem 1fr 1fr 1fr 2rem;
  grid-template-rows: 3rem 1fr 1fr 3rem;
  grid-row-gap: 1rem;
  grid-column-gap: 2rem;
}

.stock__card {
  background-color: #ffffff;
  border-radius: 1rem;
  box-shadow: 0 7px 30px -10px rgba(150, 170, 180, 0.5);
  display: flex;
  flex-direction: column;
  align-items: center;
  justify-content: center;
}

.card__1 {
  grid-row: 2/3;
  grid-column: 2/3;
}

.card__2 {
  grid-row: 2/3;
  grid-column: 3/4;
}

.card__3 {
  grid-row: 2/3;
  grid-column: 4/5;
}

.stock__canvas {
  height: 65%;
  position: relative;
  top: 1rem;
}

.stock__down__data {
  width: 90%;
  height: 30%;
  display: flex;
}

.stock__down__data__name {
  width: 90%;
}

.stock__logo {
  width: 40%;
  display: flex;
  justify-content: center;
  align-items: center;
}

.stock__name {
  height: 50%;
  width: 100%;
  display: flex;
  justify-content: flex-start;
  align-items: center;
}

.stock__exchange {
  height: 50%;
  display: flex;
  justify-content: flex-start;
  align-items: center;
  width: 100%;
}

.logoCard {
  width: 5rem;
  opacity: 1;
}

.stockName__span {
  margin-left: 1rem;
  margin-top: 1rem;
  font-size: 1.7rem;
  font-weight: bold;
  color: black;
}

.stockSymbol__span {
  margin-left: 1rem;
  margin-bottom: 1rem;
  font-size: 1.4rem;
  font-weight: bold;
  color: black;
}

.last__x__days {
  height: 2rem;
  width: 90%;
  display: flex;
  justify-content: space-around;
  align-items: center;
}

.div__last__x_days {
  height: 100%;
  z-index: 10000;
}

.a__last__x_days {
  cursor: pointer;
}

.active {
  font-weight: bold;
  color: #5d7de7;
}

